SELECT DISTINCT ?player WHERE {
  # Step 1: Identify organizations associated with Džemal Berberović
  ?team <http://dbpedia.org/ontology/player> <http://dbpedia.org/resource/Džemal_Berberović> .

  # Step 2: Find coaches who are soccer players and sports managers for these teams
  ?coach <http://dbpedia.org/ontology/coach> ?team ;
         <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/SoccerPlayer>, <http://dbpedia.org/ontology/SportsManager> .

  # Step 3: Determine players who have played under these coaches
  ?player <http://dbpedia.org/ontology/coach> ?coach ;
          <http://dbpedia.org/ontology/player> ?team .

  # Step 4: Check if Igor Bišćan has also played alongside any of these identified players
  ?match <http://dbpedia.org/ontology/team1> ?team ;
         <http://dbpedia.org/ontology/team2> ?otherTeam .
  ?playerMatch <http://dbpedia.org/ontology/player> ?player ;
               <http://dbpedia.org/ontology/match> ?match .
  ?bišćanMatch <http://dbpedia.org/ontology/player> <http://dbpedia.org/resource/Igor_Bišćan> ;
                <http://dbpedia.org/ontology/match> ?match .

  FILTER(?player != <http://dbpedia.org/resource/Igor_Bišćan>)
}

